import React from "react";
import "./products.css";
import Card from "./Card";
import data from "../../Data/data";

function Products() {
  return (
    <section className="card-container">
      {data.map((ele,i)=>{
        return <Card ele={ele}></Card>
      })}
    </section>
  );
}

export default Products;
